    // padding:"120px 20px 0px 260px",
    backgroundColor: "#800080",
  };
  const navistyle = {
    color: "white",
  };
  const buttonstyle = {
    backgroundColor: "#800080",
    color:"white"
  };

  return (
    <div>
      <Menu style={mystyle} size="large">
        <Menu.Item><Button  as={NavLink} to="/naxusclub" inverted>NAXUS CLUB</Button></Menu.Item>
